import React, { Component } from "react";
import { connect } from "react-redux";
class UserCard extends Component {
  render() {
    return <div></div>;
  }
}
function mapStateToProps({ users }, { id }) {
  const user = users[id];
  return {
    user,
  };
}

export default connect(mapStateToProps)(UserCard);
